superWin="SUPER WIN",e.winCelebration_megaWin="MEGA WIN",e.winCelebration_legendaryWin="LEGENDARY  WIN",e.start_btn="INICIAR",e.freeSpinAward="PARTIDAS GRATUITAS CONCEDIDOS",e.introtext_1="GIGANTE\nMULTIPLICADOR DE GANANCIAS",e.introtext_2="EL MULTIPLICADOR DE GANANCIAS COMIENZA EN UNO Y AUMENTA DESPU\xc9S DE CADA REACCI\xd3N",e.introtext_3="\xa1GANE TIRADAS GRATIS ADICIONALES CON 3 O M\xc1S S\xcdMBOLOS SCATTER!",e.introtext_4="12",e.outrotext_1="\xa1FELICIDADES!",e.outrotext_2="HA GANADO",e.outrotext_3="00",e.freegameText1="PARTIDA GRATIS",e.freegameText2="0",e.freegameText3="DE",e.freegameText4="12",e.freegameText5="GANANCIAS TOTALES",e.freegameText6="20500",e.freegameText7="MULTIPLICADOR",e.manywaysText="117649",e.maxWinOdds="Probabilidad m\xe1xima de ganar: 1:",e.realityCheckText1="Ten en cuenta que:",e.realityCheckText2="Has estado jugando durante",e.realityCheckText3="horas y",e.realityCheckText4="minutos.",e.realityCheckText5="Puede consultar su historial de juegos en la secci\xf3n de cuenta del sitio web del casino.",e.realityCheckText6="CONTINUAR",e.realityCheckText7="SALIDA",e.gameGuideintro1="\xa1Bienvenidos a GODDESS OF FIRE!",e.gameGuideintro1_1="Esta tragaperras ofrece a los jugadores una experiencia \xfanica invit\xe1ndoles a un mundo completamente distinto con la diosa del fuego, emocionantes aventuras y piedras preciosas.",e.gameGuideHeading2="El juego",e.gameGuideText2_1="Resumen",e.gameGuideText2_2="Rodillos:",e.gameGuideText2_3="Maneras: 117649",e.gameGuideText2_4="S\xedmbolo Scatter: F, I, R, E y Bola de fuego",e.gameGuideText2_5="S\xedmbolo WILD: Volc\xe1n",e.gameGuideText2_6="Caracter\xedstica: Consigue cuatro Scatter FIRE para ganar Partidas Gratuitas con un multiplicador incremental.",e.gameGuideText2_7="RTP:",e.gameGuideText2_8="Apuesta M\xedn:",e.gameGuideText2_9="Apuesta M\xe1x:",e.gameGuideHeading3="S\xedmbolos y L\xedneas ganadoras",e.gameGuideText3_1="Este juego tiene 6 carretes y 10 s\xedmbolos regulares. Las ganancias se eval\xfaan de 117649 maneras. Esto significa que una secuencia de varios s\xedmbolos en carretes consecutivos -empezando por la izquierda- forma una combinaci\xf3n ganadora independientemente de la posici\xf3n en el propio carrete. Si los s\xedmbolos aparecen en un carrete varias veces, se cuentan m\xfaltiples formas.",e.gameGuideText3_2="El WILD sustituye a todos los s\xedmbolos excepto al Scatter.",e.gameGuideHeading4="CARRETES CUEVA",e.gameGuideText4_1="Cada rodillo de cueva a\xf1ade un s\xedmbolo al rodillo de abajo (rodillos 2, 3, 4 y 5).",e.gameGuideHeading5="REACCIONES",e.gameGuideText5_1="Cada s\xedmbolo ganador forma parte de una reacci\xf3n y es sustituido por otros s\xedmbolos que vienen desde arriba en los rodillos y desde la derecha en la cueva.",e.gameGuideHeading6="PARTIDAS GRATUITAS",e.gameGuideText6_1="Consigue cuatro Scatters de FIRE para ganar 12 Partidas Gratuitas.",e.gameGuideText6_2="Cada Scatter extra a\xf1ade cinco Partidas Gratuitas adicionales.",e.gameGuideHeading7="MULTIPLICADOR DE GANANCIAS GIGANTE",e.gameGuideText7_1="El multiplicador de ganancias comienza en uno y aumenta despu\xe9s de cada reacci\xf3n.",e.gameGuideHeading8="PARTIDA GRATIS SCATTER",e.gameGuideText8_1="Las bolas de fuego son Scatters de Partidas Gratuitas y s\xf3lo aparecen en los rodillos de la cueva.",e.gameGuideText8_2="3 Scatters = 5 Partidas Gratuitas extra",e.gameGuideText8_3="4 Scatters = 10 Partidas Gratuitas extra",e.gameGuideHeading9_0="Instrucciones de juego",e.gameGuideHeading9_1_1="La consola muestra los siguientes valores y elementos de control:",e.gameGuideHeading9_1_2="[APUESTA]: Se juega con una apuesta fija de 20.",e.gameGuideHeading9_1_2_0="La apuesta en tu moneda es igual a la apuesta mostrada multiplicada por el valor de la moneda.",e.gameGuideHeading9_1_3="[VALOR MONEDAS]: El valor monetario actualmente elegido.",e.gameGuideHeading9_1_4="Haz clic en [+] o [-] para ajustar tu valor monetario.",e.gameGuideHeading9_1_5="[APUESTA M\xc1X]: Al hacer clic en [APUESTA M\xc1X], su apuesta se ajustar\xe1 inmediatamente al valor m\xe1ximo de moneda.",e.gameGuideHeading9_1_6="Al hacer clic dos veces en [APUESTA M\xc1X], se establecer\xe1 el valor m\xe1ximo de moneda y se iniciar\xe1 la tirada.",e.gameGuideHeading9_1_7="[GIRAR]: Haga clic en el bot\xf3n [GIRAR] para realizar su apuesta y hacer girar los rodillos una vez. Restar\xe1 la cantidad fijada de su saldo.",e.gameGuideHeading9_1_8="[TIR. AUTO.]: Haz clic en este bot\xf3n para abrir el men\xfa Tirada Autom\xe1tica. Para m\xe1s informaci\xf3n, consulta la secci\xf3n Modo Tirada Autom\xe1tica.",e.gameGuideHeading9_1_9="[GANANCIAS]: Las ganancias totales de tu \xfaltima ronda, en valor monetario y en tu moneda.",e.gameGuideHeading9_1_10="[MONEDAS]: El saldo actual se muestra en valor de moneda.",e.gameGuideHeading9_1_11="[SALDO]: El saldo actual en su moneda.",e.gameGuideHeading9_1_12="El saldo en su moneda es igual al saldo de monedas mostrado multiplicado por el valor de la moneda.",e.gameGuideHeading9="Valoraci\xf3n de ganancias",e.gameGuideText9_1="Los rodillos se detienen autom\xe1ticamente uno tras otro de izquierda a derecha.",e.gameGuideText9_2="Una vez que los rodillos se han detenido, tus ganancias se calculan y se suman.",e.gameGuideText9_3="Todas las ganancias comienzan con el rodillo m\xe1s a la izquierda y se pagan de izquierda a derecha en rodillos consecutivos. Los pagos se multiplican por la apuesta.",e.gameGuideText9_4="Los s\xedmbolos Scatter no se valoran en las l\xedneas ganadoras. Solo es relevante su n\xfamero total en los rodillos.",e.gameGuideText9_5="Si hay varias posibilidades de interpretar el resultado , por ejemplo debido a los s\xedmbolos WILD, ganadora se te dar\xe1 siempre el premio m\xe1s alto posible.",e.gameGuideText9_6="Encontrar\xe1s todos los premios y combinaciones ganadoras en la tabla de ganancias.",e.gameGuideText9_7="En caso de que el juego se interrumpa durante una partida o evaluaci\xf3n ganadora, la partida se recuperar\xe1 despu\xe9s de reiniciar el juego.",e.gameGuideHeading10="Configuraci\xf3n del juego",e.gameGuideText10_1="Inicio: Cierra el juego.",e.gameGuideText10_2="Haz clic en el bot\xf3n [?] para ver las explicaciones sobre c\xf3mo jugar y las reglas del juego.",e.gameGuideText10_3="Haz clic en el bot\xf3n [i] para acceder a la tabla de pagos, en la que encontrar\xe1s informaci\xf3n sobre ganancias, l\xedneas ganadoras y opciones del juego.",e.gameGuideText10_4="Haz clic en el bot\xf3n con el s\xedmbolo de sonido para activar o desactivar el sonido.",e.gameGuideText10_5="Haz clic en el bot\xf3n con el s\xedmbolo de engranaje para abrir un men\xfa en el que podr\xe1s desactivar y activar opciones como giro turbo, pantalla completa, m\xfasica, etc.",e.gameGuideText10_6="Configuraci\xf3n",e.gameGuideText10_7="Mostrar pantalla introductoria: Activa o desactiva la visualizaci\xf3n de la pantalla introductoria en la siguiente visita.",e.gameGuideText10_8="Pantalla completa: Haz clic en este bot\xf3n para activar o desactivar la funci\xf3n de pantalla completa.",e.gameGuideText10_9="M\xfasica: Enciende o apaga la m\xfasica.",e.gameGuideText10_10="Pulsar barra espaciadora para girar: Permite usar la barra espaciadora para girar.",e.gameGuideText10_11="Turbo Spin: Desactiva o activa el Turbo Spin.",e.gameGuideHeading11="Modo Tirada Autom\xe1tica",e.gameGuideText11_0="El Modo Tirada Autom\xe1tica te permite empezar una cantidad seleccionada de partidas en una secuencia autom\xe1tica sin tener que empezarlas una a una.",e.gameGuideText11_1="Las Partidas Gratuitas no se empiezan autom\xe1ticamente con el modo Tirada Autom\xe1tica, as\xed que no podr\xe1s saltarte ninguna serie de Partidas Gratuitas.",e.gameGuideText11_2="Mientras el modo Tirada Autom\xe1tica est\xe9 activo, los giros se iniciar\xe1n autom\xe1ticamente con la apuesta seleccionada.",e.gameGuideText11_3="Haz clic en el bot\xf3n [TIR. AUTO.] para abrir la ventana de configuraci\xf3n de Tirada Autom\xe1tica, donde puede configurar el modo de Tirada Autom\xe1tica.",e.gameGuideText11_4="Ofrecemos una versi\xf3n b\xe1sica y una experta para el modo Tirada Autom\xe1tica.",e.gameGuideHeading12="Modo b\xe1sico",e.gameGuideText12_1="La serie Tirada Autom\xe1tica se iniciar\xe1 autom\xe1ticamente despu\xe9s de hacer clic en el bot\xf3n [TIR. AUTO.].",e.gameGuideText12_2="La serie Tirada Autom\xe1tica terminar\xe1n autom\xe1ticamente cuando se complete el n\xfamero de vueltas seleccionado.",e.gameGuideHeading13="Modo experto",e.gameGuideText13_1="Configura un valor para las siguientes opciones:",e.gameGuideText13_2="Elija uno de los ajustes preestablecidos de giro de Tirada Autom\xe1tica dados.",e.gameGuideText13_3="Detener el Tirada Autom\xe1tica en cualquier victoria: Si activas este interruptor, la serie Tirada Autom\xe1tica terminar\xe1 autom\xe1ticamente si tienes una victoria.",e.gameGuideText13_4="[Si una sola victoria supera]: Utilice el control deslizante para establecer un l\xedmite de ganancia \xfanica. La serie Tirada Autom\xe1tica terminar\xe1 autom\xe1ticamente cuando consigas una victoria tan alta o m\xe1s.",e.gameGuideText13_5="[Si el saldo aumenta en]: Utilice el control deslizante para establecer un l\xedmite de ganancias. La serie AutoStart finalizar\xe1 autom\xe1ticamente cuando su SALDO aumente en esta cantidad.",e.gameGuideText13_6="[Si el saldo disminuye en]: Utilice el control deslizante para establecer un l\xedmite de p\xe9rdidas. La serie AutoStart finalizar\xe1 autom\xe1ticamente cuando su SALDO disminuya en esta cantidad.",e.gameGuideText13_7="Seg\xfan tu pa\xeds, tendr\xe1s que configurar un valor para todas las opciones o solo algunas de ellas.",e.gameGuideText13_8="Para definir el l\xedmite de ganancias y de p\xe9rdidas, tienes que seleccionar primero un n\xfamero de Tirada Autom\xe1tica.",e.gameGuideText13_9="Tu website puede desactivar algunas de las opciones. En tal caso, no podr\xe1s configurar ning\xfan valor.",e.gameGuideText13_10="Una vez hayas configurado todas las opciones necesarias, se habilitar\xe1 el bot\xf3n [INICIAR]. Al hacer clic en \xe9l, la serie Tirada Autom\xe1tica empiezan.",e.gameGuideText13_11="Si no quieres empezar una serie Tirada Autom\xe1tica, sal del men\xfa al hacer clic en el bot\xf3n [CANCELAR].",e.gameGuideHeading14="Finalizar el modo Tirada Autom\xe1tica",e.gameGuideText14_1="La serie Tirada Autom\xe1tica finalizar\xe1n autom\xe1ticamente una vez se haya conseguido alguno de los l\xedmites configurados.",e.gameGuideText14_2="La serie Tirada Autom\xe1tica activa se puede desactivar haciendo clic en el bot\xf3n rojo [TIR. AUTO.].",e.gameGuideHeading15="Sesiones abiertas",e.gameGuideText15_1="Todas las sesiones abiertas, que no sean concluidas por el jugador y cualquier transacci\xf3n futura para esas sesiones finalizar\xe1n despu\xe9s de un per\xedodo de tiempo. Los per\xedodos son definidos por el regulador respectivo por jurisdicci\xf3n:",e.gameGuideText15_2=".COM: 30 dias",e.gameGuideText15_3="Italia: 7 dias",e.gameGuideText15_4="Espa\xf1a: 7 dias",e.gameGuideText15_5="Dinamarca: 90 dias",e.gameGuideText15_6="Suecia: 90 dias",e.gameGuideText15_7="Rumania: 30 dias",e.gameGuideText15_8="Portugal: 90 dias",e.gameGuideText16="El juego tiene un porcentaje de retorno al jugador (RTP) del ",e.gameGuideText16_1="El RTP representa el porcentaje te\xf3rico de dinero que el jugador gasta a largo plazo en un juego.",e.gameGuideText17="Los problemas de funcionamiento invalidan todos los juegos y ganancias.",e.noInternetPopUpText1="Message",e.noInternetPopUpText2="The internet connection is interrupted. Please restart the game.",e.noInternetPopUpText3="Insufficient funds. Please recharge your balance to continue playing.",e.noInternetPopUpText4="We could not register any activity from you within the last few minutes. Do you want to continue playing?",e.noInternetPopUpText5="An unexpected error has occurred, please restart the game",e.noInternetPopUpText6="Response-Time is too long. Please restart the game.",e.vouche